function getRepetitions(str, c) {
    var rep = str.lastIndexOf(c) - str.indexOf(c);
    return rep;
}

function processData(str) {
    var oddRepetitions = {},
        sortedStr = str.split('').sort().join(''),
        reps, odds = 0;

    for (var i = 0; i < str.length; i++) {
        if (oddRepetitions[str[i]]) {
            continue;
        }

        reps = getRepetitions(str, str[i]);
        oddRepetitions[str[i]] = reps % 2 === 1;
    }

    console.log(oddRepetitions);

    // if (Object.keys(oddRepetitions).length === str.length) {
    //     return 'NO';
    // }

    for (var c in oddRepetitions) {
        if (odds > 1) {
            return 'NO';
        }
        if (oddRepetitions[c]) {
            odds++;
        }
    }

    return 'YES';
} 

